script: |
  super -f text -I q6235.spq | sort > q6235.out

inputs:
  - name: q6235.spq
    data: |
      SELECT ALL col2 / + CAST ( + col0 AS REAL ) * - + CAST ( NULL AS INTEGER ) + + - col1 + + + ( 27 ) - - col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN 35 / + col0 + - col0 AND col0 * 25 + col0;
  - name: tab2

outputs:
  - name: q6235.out
    data: |
